export default function Main(props){
    const {bbb} = props;
    return (
        <div className="col-2 block">
            <h2>Products</h2>
            <div className="row">
                {bbb.map((product) =>(
                    <div key={product.id}>{product.name}</div>
                ))}
            </div>
        </div>
    );
}
